import React from 'react'
import { Link } from 'react-router-dom';
import { useNavigate } from 'react-router-dom';
import { STAMMERING_STATUS_MAP } from '../constants/map';


export const Mentor = () => {

    // let navigate = useNavigate();

    // const handleBooking = (e) => {
    //     navigate("/mentor/" + props.mentorObj.name, {
    //         replace: false, state: { mentorObj: props.mentorObj }
    //     });
    // }

    return (
        <div className='container-fluid'>
            <div className="container-fluid text-center t1">
                <h3 className="fw-bolder">Meet Our Mentor</h3>
                <div className="text-ceneter fw-normal mt-3">
                    <p>Realize your fullest potential and lay a concrete path to recovery with industry-best doctors and <br /> experienced mentors who are here to give you affordable, but and step-by-step support<br />to embolden you with your highest self!</p>
                </div>
                <button type="button " class="fw-bolder btn btn-primary btn-lg">I want to become a mentor!</button>
            </div>
            <div class="mt-4 d-flex justify-content-around">
                <div class="row mt-4 crd">
                    <div class="col-md-4 crdb">
                        <div class="card img-fluid" style="width: 18rem;">
                            <img src="images/mentor.png" class="card-img-top" alt="..."/>
                                <div class="card-body text text-center  mt-3">
                                    <h5 class="card-title fw-bolder">1:1 Mentorship</h5>
                                    <p class="card-text mt-3">Speech Therapists,<br/>Audiologists, Psychologists,<br/>and experienced Stammerers,<br/>all here to help you at the<br/>most affordable cost.
                                    </p>
                                    </div>
                                    </div>
                                    </div>

                                        <div class="col-md-4 crdb">
                                            <div class="card img-fluid" style="width: 18rem;">
                                                <img src="images/joinevent.png" class="card-img-top" alt="..."/>
                                                    <div class="card-body text text-center  mt-3">
                                                        <h5 class="card-title fw-bolder">Join Events</h5>
                                                        <p class="card-text mt-3">Interact with your stammering<br/>friends who have overcome<br/>stammering. Gaining<br/>confidence, career lessons and<br/>much more!
                                                        </p>
                                                        </div>
                                                        </div>
                                                        </div>

                                                            <div class="col-md-4 crdb">
                                                                <div class="card img-fluid" style="width: 18rem;">
                                                                    <img src="images/happy.jpg" class="card-img-top" alt="..."/>
                                                                        <div class="card-body text text-center  mt-3">
                                                                            <h5 class="card-title fw-bolder">For change makers</h5>
                                                                            <p class="card-text mt-3">Parents, siblings, and friends of<br/>stammerers! You're all invited to<br/>connect, share your experiences<br/>and become emotionally<br/>intelligent.
                                                                            </p>
                                                                            </div>
                                                                            </div>
                                                                            </div>
                                                                        </div>
                                                                </div>
                                                            </div>
                                                            )
}
